import { Button } from "bootstrap";
import React from "react";

function Dashboard() {
  return (
    <div className="container-fluid" >
      <div className="row">
        <div className="col col-sm-3">
          <nav className="nav flex-column">
            <button class="btn" className="nav-link mt-5" style={{backgroundColor:'#9C9C9C'}} >Villes</button>
            <button class="btn" className="nav-link mt-5" style={{backgroundColor:'#9C9C9C'}} >Zones</button>
            <button class="btn" className="nav-link mt-5" style={{backgroundColor:'#9C9C9C'}}>Restaurants</button>
            <button class="btn" className="nav-link mt-5" style={{backgroundColor:'#9C9C9C'}}>Utilisateurs</button>
          </nav>
        </div>
        
      </div>
    </div>
  );
}

export default Dashboard;
